import React, { Component } from 'react';
import './style.scss';
import cardData from "../../cards.json";
import Card from '../Card';

class Game extends Component {
    handleClick = (cardId) => {
        alert('you clicked Card ID: ${cardId}');
    }

    render() {
        return (

            <div>
                {cardData.map((card) => (
                    <Card   
                        image={card.image} 
                        name={card.name} 
                        key={card.id}
                        id={card.id}
                        handleClick={this.handleClick}
                    />  
                 ))}    
            </div>
        );
    }
}

export default Game;
